import styled from "@emotion/styled";

export const Button = styled.button`
  width: 41rem;
  height: 6rem;
  margin-top: 1rem;
  background-color: black;
  border-radius: 15px;
  color: #ffffff;
  border: none;
  font-size: 2.6rem;
  @media screen and (max-width: 40rem) {
    font-size: 2rem;
    width: 33.4rem;
    height: 5rem;
  }
`;
